import React from 'react'
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom'
import './App.css'
import BookList from './BookList'

function App() {
	return (
		<div className="App">
			<Router>
				<Routes>
					<Route path='/' element={<BookList />} />
				</Routes>
			</Router>
		</div>
	)
}

export default App;
